import React from 'react'

import logo from '../media/logo.png'


function DiscussionRow() {

    return (
        <div className='flex'>
            <div className='mr-2'>
                <img src={logo} alt="logo" />
            </div>
        </div>
    )
}

export default DiscussionRow
